import React, {Component}from 'react';
import './App.css';
import './css/responsive.css';
import BaseComponent from './component/BaseComponent'

class App extends Component {
    constructor(props){
        super(props)
        this.state = {
            isClicked:false
        }
    }
    clickHandler(){
        this.setState({
            isClicked:true
        })
}
    render(){
        return(
            /*this.state.isClicked ? <BaseComponent></BaseComponent> : <div>No ui</div>*/
            <div className="container">
                <div className="row" align="center">
                    <div className="col-md-12">
                        <button onClick={this.clickHandler}>Click to Proceed</button>
                    </div>
                </div>

            </div>
        )
    }
}

export default App;
